import React from 'react'
import Tweet from './Tweet'

class Tweets extends React.Component{

    render(){
        return(
            <div className="display">
                <div className="columns">
                    {
                        this.props.contacts.map(t => {
                            return(
                                <div className="column is-3">
                                    <Tweet tweet={t}/>
                                </div>
                            )
                        })
                    }
                </div>
            </div>
        );
    }
}

export default Tweets;
